def fq2_mul_fq12(fq2, fq12):
    result = copy.deepcopy(fq12)
    result.q1.q2 *= fq2
    result.q1.q1 *= fq2
    result.q1.q0 *= fq2
    result.q0.q2 *= fq2
    result.q0.q1 *= fq2
    result.q0.q0 *= fq2
    return result

